import React from 'react'
import Intro from '../intro/Intro'
import $ from 'jquery'

import './css/landing.css'
import slideTop from '../../image/slide-top.jpg'
import slideBottom from '../../image/slide-bottom.jpg'


function LandingPage(){
    $(document).ready(function() {
        $(".enter").click(function() {
           unlock($(".enter"));
        });
     });

     function open(left, right, button) {
        TweenLite.to(left, 1.5, { width: 0 });
        TweenLite.to(right, 1.5, { width: 0 });
        TweenLite.to(button, 1.5, { "margin-left" : "-60px" , onComplete: function(){
           // Remove doors and button
           left.parent().remove();
           button.remove();
        }});
     }

     function unlock(el){
        TweenLite.to(el, 0.5, { transform: "rotate(90deg)", onComplete: function(){
           open($(".door .left"), $(".door .right"), el);
        }})
     }
    return(
        <div className="container">
            container
            <img className="slide-top" src={slideTop} alt="slide du plateau de jeu top"/>
            <Intro className="video"/>
            <img className="slide-bottom" src={slideBottom}  alt="slide du plateau de jeu bottom"/>

            <div class="jcontentle">
                <a href="LINK" target="_blank" id="jalter1" class="jalterre">Grupo 1</a>
                <a href="LINK" target="_blank" id="jalter2" class="jalterre">Grupo 2</a>
                <a href="LINK" target="_blank" id="jalter3" class="jalterre">Grupo 3</a>
                <a href="LINK" target="_blank" id="jalter4" class="jalterre">Grupo 4</a>
                <a href="LINK" target="_blank" id="jalter5" class="jalterre">Grupo 5</a>
                <a href="http://www.oursourcecode.net/u6090" target="_blank" class="jcredit">By Jackin</a>
            </div>
        </div>
    )
}

export default LandingPage
